import requests, json, time
from contextlib import closing

class get_photos(object):
	def __init__(self):
		self.photos_id = []
		self.download_server = 'https://unsplash.com/photos/xxx/download?force=true'#图片下载地址
		self.target = 'https://unsplash.com/napi/photos?page=xxx&per_page=30'#图片链接获取地址，30：每页中有30张图片

    # 获取图片ID
	def get_ids(self, page):
		target = self.target.replace('xxx', str(page))
		req = requests.get(url = target)
		html = json.loads(req.text)
		for idnum in html:
			self.photos_id.append(idnum['id'])
		time.sleep(1)
		for i in range(3565):	#总共有3565页图片
			print('获取到页数：',i)
			page = page + 1
			next_page = self.target.replace('xxx', str(page))
			req = requests.get(url = next_page)
			html = json.loads(req.text)
			for each in html:
				self.photos_id.append(each['id'])
			time.sleep(1)
			# if i % 2 == 0:
			if i  :#防止ID丢失，将其写入文本中
				with open('id.txt','a') as fid:
					fid.write('\n'+str(i)+'\n')
					fid.write(str(self.photos_id))


	def download(self, photo_id, filename):
		target = self.download_server.replace('xxx', photo_id)
		with closing(requests.get(url = target, stream = True)) as r:
			with open('%s.jpg' % filename, 'ab+') as f:
				for chunk in r.iter_content(chunk_size = 1024):
					if chunk:
						f.write(chunk)
						f.flush()

if __name__ == '__main__':
	gp = get_photos()
	print('图片ID获取中...')
	gp.get_ids(1)
